import React, {Component} from 'react';
import HighchartsReact from 'highcharts-react-official';
import Highcharts from 'highcharts';
import HighchartsSunburst from 'highcharts/modules/sunburst';
import data from './data';
import './datavis.css';
import DropdownButton from 'react-bootstrap/DropdownButton';
import Dropdown from 'react-bootstrap/Dropdown';
HighchartsSunburst(Highcharts);

const options = [
  'Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday', 'Saturday', 'Sunday'
];

class DataVisualization extends Component {

  onSelect(event){
    console.log(event);
  }

  render() {
    return (
      <div>
        <DropdownButton 
          id="dropdown-item-button" 
          title="Choose a TimeStamp"
          onSelect={this.onSelect}
        >
          <Dropdown.Item as="button" value="Monday">Monday</Dropdown.Item>
          <Dropdown.Item as="button" value="Tuesday">Tuesday</Dropdown.Item>
          <Dropdown.Item as="button" value="Wednesday">Wednesday</Dropdown.Item>
          <Dropdown.Item as="button" value="Thursday">Thursday</Dropdown.Item>
          <Dropdown.Item as="button" value="Friday">Friday</Dropdown.Item>
          <Dropdown.Item as="button" value="Saturday">Saturday</Dropdown.Item>
          <Dropdown.Item as="button" value="Sunday">Sunday</Dropdown.Item>
        </DropdownButton>

        <HighchartsReact
          constructorType={"chart"}
          highcharts={Highcharts}
          options={data}
        />
      </div>
    );
  }
}

export default DataVisualization;
